INSERT INTO `scholarship` (`id`, `title`, `description`, `levelOfStudy`, `universityId`, `applicationId`, `country`) VALUES
(1, 'Fully Funded Undergraduate Scholarships in USA 2025', 'The HAAA Scholarship invites applications from Arab students who are interested to undertake undergraduate studies at Harvard University USA. In 2010, the Harvard Arab Alumni Association (HAAA) introduced the HAAA Scholarship Fund, the first of its kind at Harvard, to promote its goal of raising the amount of Arab students at Harvard.', 'Undergraduate', 2, 1, 'USA'),
(2, 'Fully Funded Undergraduate Scholarships in USA 2025', 'Clark Global Scholarship Program 2022 is a fully funded undergraduate scholarship for international students. This scholarship Program covers $15,000 to $25,000 per year for four years, contingent upon meeting academic standards for renewal.', 'Undergraduate', 1, 2, 'UK'),
(3, 'adfaerwqw', 'werqwereqw', 'undergraduate', 2, 5, 'USA'),
(4, 'adfaerwqw', 'werqwereqw', 'undergraduate', 2, 5, 'USA'),
(5, 'University of Waterloo 2025', 'The University of Waterloo is presenting the David Johnston–Lebovic Foundation International Experience Awards to the highly successful candidates in support of Canadian and international students. This is a full-time program open to students from around the world who want to study in any Waterloo Faculty undergraduate and graduate degree program.Faculties will nominate eligible students based on the Faculty’s award allocation. Students will be selected based on academic excellence as demonstrated through their application for admission to the graduate program.', 'undergraduate', 4, 6, 'China'),
(6, 'Friedrich Ebert Stiftung Scholarships 2025 (Fully Funded)', 'Friedrich Ebert Stiftung Foundation Scholarship 2025-2026 is a fully funded scholarship. This scholarship is offered for undergraduate and postgraduate studies in Germany. This Scholarship will cover a monthly basic stipend of up to EUR 850, health insurance expenses, and where applicable, family and baby allowances.', 'undergraduate', 8, 7, 'Germany'),
(7, 'Friedrich Ebert Stiftung Scholarships 2025 (Fully Funded)', 'Friedrich Ebert Stiftung Foundation Scholarship 2025-2026 is a fully funded scholarship. This scholarship is offered for undergraduate and postgraduate studies in Germany. This Scholarship will cover a monthly basic stipend of up to EUR 850, health insurance expenses, and where applicable, family and baby allowances.', 'Masters', 8, 8, 'Germany'),
(8, 'Friedrich Ebert Stiftung Scholarships 2025 (Fully Funded)', 'Friedrich Ebert Stiftung Foundation Scholarship 2025-2026 is a fully funded scholarship. This scholarship is offered for undergraduate and postgraduate studies in Germany. This Scholarship will cover a monthly basic stipend of up to EUR 850, health insurance expenses, and where applicable, family and baby allowances.', 'PhD', 8, 9, 'Germany'),
(10, 'DAAD Scholarship ', 'Courses Offered:\r\nEconomic Sciences, Law\r\nAgricultural and Forest Sciences\r\nArt, Design\r\nEngineering and Natural Sciences\r\nHumanities and Social Sciences\r\nLanguage and Cultural Studies\r\nMathematics, Natural Sciences\r\nMedicine, Health Sciences\r\nYou can also see the complete list of available Postgraduate Courses.\r\nProgram Period: Between 12 and 36 months depending on the length of the chosen study program.', 'Masters', 29, 11, 'Germany'),
(11, 'DAAD Scholarship ', 'Courses Offered:\r\nEconomic Sciences, Law\r\nAgricultural and Forest Sciences\r\nArt, Design\r\nEngineering and Natural Sciences\r\nHumanities and Social Sciences\r\nLanguage and Cultural Studies\r\nMathematics, Natural Sciences\r\nMedicine, Health Sciences\r\nYou can also see the complete list of available Postgraduate Courses.\r\nProgram Period: Between 12 and 36 months depending on the length of the chosen study program.', 'PhD', 29, 12, 'Germany'),
(13, 'Dundee Global Excellence Scholarship 2025', 'Eligibility Criteria for Dundee Global Excellence Scholarship\r\nTo qualify for Global Excellence Scholarship, candidate must fulfill all of the following requirements below:\r\n\r\nRequired Language: English.\r\nEligible Countries: All world countries\r\nUndergraduate Admission Requirements:\r\nHold an academic offer of entry for an undergraduate programme in any of our academic schools, beginning in September 2022. If you are studying a programme in the School of Medicine or Dentistry, then you are not eligible.\r\nHold International Fee status, as determine by the University;\r\nHave achieved a UK AAB at A Level (or above) or equivalent to this level at the discretion of the University.\r\nPostgraduate Admission Requirements:\r\nHold an academic offer of entry for a postgraduate taught programme in any of our academic schools, beginning in September 2022 or January 2023. The programe must be a full time, 180 credit, 12 month programme;\r\nHold International Fee status, as determined by the University;\r\nHave achieved either a UK 1st Class Honours degree or degree considered as equivalent to this level at the discretion of the University', 'undergraduate', 30, 14, 'UK'),
(14, 'Dundee Global Excellence Scholarship 2025', 'Eligibility Criteria for Dundee Global Excellence Scholarship\r\nTo qualify for Global Excellence Scholarship, candidate must fulfill all of the following requirements below:\r\n\r\nRequired Language: English.\r\nEligible Countries: All world countries\r\nUndergraduate Admission Requirements:\r\nHold an academic offer of entry for an undergraduate programme in any of our academic schools, beginning in September 2022. If you are studying a programme in the School of Medicine or Dentistry, then you are not eligible.\r\nHold International Fee status, as determine by the University;\r\nHave achieved a UK AAB at A Level (or above) or equivalent to this level at the discretion of the University.\r\nPostgraduate Admission Requirements:\r\nHold an academic offer of entry for a postgraduate taught programme in any of our academic schools, beginning in September 2022 or January 2023. The programe must be a full time, 180 credit, 12 month programme;\r\nHold International Fee status, as determined by the University;\r\nHave achieved either a UK 1st Class Honours degree or degree considered as equivalent to this level at the discretion of the University', 'Masters', 30, 15, 'UK'),
(15, 'University of Exeter Scholarships 2025-2026', 'Eligibility Criteria for University of Exeter Undergraduate Scholarships\r\nTo qualify for University of Exeter Scholarships, candidate must fulfill all of the following requirements below:\r\n\r\nRequired Language: English\r\nEligible Countries: All world countries.\r\nAre classified as an International student for fees purposes (including any EU students required to pay International fees);\r\nAlready hold an offer for an eligible Undergraduate or Masters degree at the University of Exeter, commencing in September 2025.\r\nIf you are yet to make your Masters programme application then please visit our Postgraduate taught study pages for September 2025 entry. \r\n\r\nScholarship recipients are selected on:\r\n\r\nAcademic merit, based on the information you have supplied in your programme application.  Applicants will be expected to demonstrate that they have achieved or are able to achieve the equivalent of UK upper second class degree. See our Entry Requirements pages for further guidance.\r\nThe ability to demonstrate the following as part of the application process: academic ambition; future career ambitions; a genuine need for the scholarship and how this will support your ambitions; a sense of social responsibility and willingness to engage with the Exeter community.  \r\nIf you are yet to make your programme application then please visit our Undergraduate study pages.  \r\n\r\nScholarship recipients are selected on:\r\n\r\nAcademic merit, based on the information you have supplied in your UCAS application.  Applicants will typically be expected to demonstrate that they have achieved or are able to achieve the equivalent of GCE A level grades AAB or International Baccalaureate 34 points. For the Business School, the expectation is higher, set at GCE A level grades A*AA or equivalent.  See our Entry Requirements pages for further guidance.\r\nThe ability to demonstrate the following as part of the application process: academic ambition; future career ambitions; a genuine need for the scholarship and how this will support your ambitions; a sense of social responsibility and willingness to engage with the Exeter community. ', 'undergraduate', 32, 16, 'UK'),
(16, 'University of Exeter Scholarships 2025-2026', 'Eligibility Criteria for University of Exeter Undergraduate Scholarships\r\nTo qualify for University of Exeter Scholarships, candidate must fulfill all of the following requirements below:\r\n\r\nRequired Language: English\r\nEligible Countries: All world countries.\r\nAre classified as an International student for fees purposes (including any EU students required to pay International fees);\r\nAlready hold an offer for an eligible Undergraduate or Masters degree at the University of Exeter, commencing in September 2025.\r\nIf you are yet to make your Masters programme application then please visit our Postgraduate taught study pages for September 2025 entry. \r\n\r\nScholarship recipients are selected on:\r\n\r\nAcademic merit, based on the information you have supplied in your programme application.  Applicants will be expected to demonstrate that they have achieved or are able to achieve the equivalent of UK upper second class degree. See our Entry Requirements pages for further guidance.\r\nThe ability to demonstrate the following as part of the application process: academic ambition; future career ambitions; a genuine need for the scholarship and how this will support your ambitions; a sense of social responsibility and willingness to engage with the Exeter community.  \r\nIf you are yet to make your programme application then please visit our Undergraduate study pages.  \r\n\r\nScholarship recipients are selected on:\r\n\r\nAcademic merit, based on the information you have supplied in your UCAS application.  Applicants will typically be expected to demonstrate that they have achieved or are able to achieve the equivalent of GCE A level grades AAB or International Baccalaureate 34 points. For the Business School, the expectation is higher, set at GCE A level grades A*AA or equivalent.  See our Entry Requirements pages for further guidance.\r\nThe ability to demonstrate the following as part of the application process: academic ambition; future career ambitions; a genuine need for the scholarship and how this will support your ambitions; a sense of social responsibility and willingness to engage with the Exeter community. ', 'Masters', 32, 17, 'UK'),
(17, 'Kingston University 2025', 'Eligibility Criteria for Kingston University Scholarships\r\nTo qualify for Kingston University Scholarships, candidate must fulfill all of the following requirements below:\r\n\r\nRequired Language: English.\r\nEligible Countries: All world countries.\r\nYou are an international student, classified as paying ‘overseas fees’.\r\nYou have received an offer for an undergraduate or postgraduate course at Kingston University.\r\nYou are not currently registered on a Kingston University degree or foundation course.', 'undergraduate', 33, 18, 'UK'),
(18, 'Kingston University 2025', 'Eligibility Criteria for Kingston University Scholarships\r\nTo qualify for Kingston University Scholarships, candidate must fulfill all of the following requirements below:\r\n\r\nRequired Language: English.\r\nEligible Countries: All world countries.\r\nYou are an international student, classified as paying ‘overseas fees’.\r\nYou have received an offer for an undergraduate or postgraduate course at Kingston University.\r\nYou are not currently registered on a Kingston University degree or foundation course.', 'Masters', 33, 19, 'UK');

